import Navigation from '../components/navigation';
import Head from 'next/head';
const Index =() => (
<div>
<Head>
<title>Main Page </title>
<link rel="stylesheet" href="//cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css" />
</Head>
<main>
<Navigation/> 
<h1>Hello </h1>
<Cpright/>
</main>
</div>
	)
export default Index;
